(function () {
    var $this = this;
    var scroller;

    if($.browser != null){
        scroller = ($.browser.webkit ? 'body' : 'html');
    } else {
        scroller = 'body';
    }

    return {
        tables: ({
            items: $('.table-container'),
            scroller: $(scroller),
            interval: null,
            drive: function () {
                this.interval = window.setTimeout(
                    (function (_this) {
                        return function () {
                            if (_this.scroller.scrollTop() < _this.items.first().offset().top) {
                                _this.scroller.stop().animate(
                                    {
                                        scrollTop: _this.items.first().offset().top
                                    },
                                    1000
                                );
                            }
                        };
                    }) (this),
                    500
                );
                return this;
            },
            resize: function () {
              this.items.each(function () {
                $(this).css({
                    width: ($(this).parent().width() - ($(this).hasClass('fluid') ? 0 : 220))
                });
              });
              return this;
            },
            bind: function () {
              var $this = this;
              $(window).on(
                'resize',
                function () {
                  $this.resize();
                }
              )
              return this;
            },
            init: function () {
              if (this.items.length) {
                this.bind().resize();//.drive();
              }
              return this;
            }
        }).init(),
        forms: ({
            mask: function (scope) {
                scope = (scope || {});
                scope.elements = $('input.cpf').inputmask({
                    mask: '999.999.999-99',
                    placeholder: "_",
                    greedy: true,
                    clearIncomplete: true
                });
                return this;
            },
            init: function (scope) {
                return this.mask();
            }
        }).init()
    };
})();